import Logo from '../../Assets/NextYa.png'
import './Header.scss'

export default ()=>{

    const [navbar, setNavBar] = useState(false);

    const changeNavBar = ()=>{
        if(window.scrollY >= 10){
            setNavBar(true);
        } else{
            setNavBar(false);
        }
    }

    window.addEventListener('scroll', changeNavBar );

    return(
        <header>
            

        </header>
    )
}
